osuint8 VTTOs_GetInterruptName(osint32 isr, const char ** interruptName)
{
  int returnValue;

  if (isr >= oskNumberOfInterruptSources)
  {
    (*interruptName) = "Unknown IRQ";
    returnValue = VTTOS_IRQ_UNKNOWN;
  }
  else
  {
    (*interruptName) = ISRNameTable[isr];
    returnValue = VTTOS_IRQ_OK;
  }
  return returnValue;
}

